import React from 'react';
import {ItemSong} from './'

const ListSong = ({song, totalDuration}) => {
    console.log(song, totalDuration)
    return (
        <div className='w-full flex flex-col py-[10]'>
            <div className='flex justify-between items-center text-xs p-[10px] text-main-100 font-semibold'>
                <span>BÀI HÁT</span>
                <span>ALBUM</span>
                <span>THỜI GIAN</span>
            </div>
            <div className='flex lex'>
                <ItemSong/>
            </div>
        </div>
    );
}

export default ListSong;
